import React from 'react';
import '../css/Nosotros.css'
function Nosotros() {
  return (
    <div>
      <h2>Nosotros</h2>
      <p>Aquí puedes agregar información sobre la historia y misión de la empresa.</p>
      <img src="ruta-a-imagen.jpg" alt="Nosotros" />
    </div>
  );
}

export default Nosotros;
